function CStr(c,f){var b=c[f],e="";for(var d=f+1;d<=f+b;d++){e+=String.fromCharCode(c[d])}return e}function Str2CStr(b){r=[b.length];for(var a=0;a<r[0];a++){r.push(b.charCodeAt(a))}return r}function QStr(c,e,b){r="";for(var d=e;d<=e+b;d++){r+=String.fromCharCode(c[d])}return r}function strcmp(d,c){d=d.toString(),c=c.toString();for(var e=0,f=Math.max(d.length,c.length);e<f&&d.charAt(e)===c.charAt(e);++e){}if(e===f){return 0}return d.charAt(e)>c.charAt(e)?-1:1};